import React from "react";
import GameBoard from "./GameBoard";
import { Router, Route } from "react-router-dom";
import GameStart from "./component/GameStart";

function App() {
  return (
    <Router>
      <Route path="/" element={<GameStart />} />
      <Route path="/game" element={<GameBoard />} />
    </Router>
  );
}

export default App;
